// API Response wrapper
export interface ApiResponse<T> {
  code: number;
  message: string;
  data: T;
}

// Auth types
export interface SendVerificationCodeRequest {
  email: string;
}

export interface SendVerificationCodeResponse {
  expire_in: number;
  dev_code?: string;
}

export interface RegisterRequest {
  username: string;
  email: string;
  password: string;
  verification_code: string;
}

export interface RegisterResponse {
  userId: number;
  username: string;
  email: string;
}

export interface LoginRequest {
  username?: string;
  email?: string;
  password: string;
}

export interface AuthTokens {
  access_token: string;
  refresh_token: string;
  token_type: string;
}

// User types
export interface User {
  userId: number;
  username: string;
  email: string;
  avatarUrl: string | null;
  bio: string | null;
  phone: string | null;
}

export interface UpdateProfileRequest {
  name?: string;
  bio?: string;
  phone?: string;
  avatarUrl?: string;
}

// Registration types
export interface RegistrationRequest {
  teamName: string;
  leader: boolean;
  note: string;
}

export interface Registration {
  registrationId: number;
  userId: number;
  teamName: string;
  leader: boolean;
  note: string;
  status?: string;
}

// Project types
export interface ProjectRequest {
  title: string;
  description: string;
  repoUrl: string;
  demoUrl: string;
}

export interface Project {
  projectId: number;
  userId: number;
  title: string;
  description: string;
  repoUrl: string;
  demoUrl: string;
  createdAt: string;
  updatedAt: string;
}

// Upload types
export interface UploadImageResponse {
  url: string;
  size: number;
  mime: string;
  filename: string;
}
